import React, { useState } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import Logo from './Logo';

const Navbar = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/');
  };

  const isActive = (path) => location.pathname === path;

  const NavButton = ({ icon, label, path, onClick }) => (
    <button
      onClick={onClick ? onClick : () => navigate(path)}
      className={`nav-button ${isActive(path) ? 'nav-button-active' : ''}`}
      style={{
        display: 'flex',
        alignItems: 'center',
        gap: '0.5rem',
        padding: '0.625rem 1.25rem',
        borderRadius: '8px',
        border: 'none',
        background: isActive(path) ? 'var(--gradient-red)' : 'transparent',
        color: isActive(path) ? 'var(--white-pure)' : 'var(--gray-medium)',
        fontWeight: '500',
        fontSize: '0.875rem',
        cursor: 'pointer',
        transition: 'all 0.3s ease',
        position: 'relative',
        overflow: 'hidden'
      }}
    >
      <span style={{ fontSize: '1.1rem' }}>{icon}</span>
      {label}
      {isActive(path) && (
        <div style={{
          position: 'absolute',
          bottom: '0',
          left: '0',
          right: '0',
          height: '2px',
          background: 'var(--white-pure)'
        }} />
      )}
    </button>
  );

  return (
    <nav className="navbar-cstech">
      <div className="navbar-content">
        <div 
          onClick={() => navigate('/dashboard')} 
          style={{ cursor: 'pointer', display: 'flex', alignItems: 'center' }}
        >
          <Logo size="md" showText={true} />
        </div>
        
        {/* Desktop Navigation */}
        <div className="nav-links" style={{ display: 'flex', gap: '0.5rem' }}>
          <NavButton
            icon="ðŸ“Š"
            label="Dashboard"
            path="/dashboard"
          />
          
          <NavButton
            icon="ðŸ“"
            label="List Upload"
            path="/upload"
          />
          
          <NavButton
            icon="ðŸ‘¥"
            label="Agents"
            path="/agents"
          />
          
          <NavButton
            icon="ðŸ“‹"
            label="Distribution"
            path="/distributed"
          />
          
          <button
            onClick={handleLogout}
            style={{
              display: 'flex',
              alignItems: 'center',
              gap: '0.5rem',
              padding: '0.625rem 1.25rem',
              borderRadius: '8px',
              border: '1px solid var(--gray-light)',
              background: 'var(--white-pure)',
              color: 'var(--red-primary)',
              fontWeight: '500',
              fontSize: '0.875rem',
              cursor: 'pointer',
              transition: 'all 0.3s ease',
              boxShadow: 'var(--shadow-light)'
            }}
            onMouseEnter={(e) => {
              e.target.style.background = 'var(--red-light)';
              e.target.style.transform = 'translateY(-1px)';
              e.target.style.boxShadow = 'var(--shadow-medium)';
            }}
            onMouseLeave={(e) => {
              e.target.style.background = 'var(--white-pure)';
              e.target.style.transform = 'translateY(0)';
              e.target.style.boxShadow = 'var(--shadow-light)';
            }}
          >
            <span style={{ fontSize: '1.1rem' }}>ðŸšª</span>
            Logout
          </button>
        </div>

        {/* Mobile Menu Button */}
        <button
          onClick={() => setIsMenuOpen(!isMenuOpen)}
          style={{
            display: 'none',
            flexDirection: 'column',
            gap: '4px',
            background: 'none',
            border: 'none',
            cursor: 'pointer',
            padding: '0.5rem'
          }}
          className="mobile-menu-btn"
        >
          <span style={{
            width: '24px',
            height: '2px',
            background: 'var(--gray-dark)',
            transition: 'all 0.3s ease'
          }} />
          <span style={{
            width: '24px',
            height: '2px',
            background: 'var(--gray-dark)',
            transition: 'all 0.3s ease'
          }} />
          <span style={{
            width: '24px',
            height: '2px',
            background: 'var(--gray-dark)',
            transition: 'all 0.3s ease'
          }} />
        </button>
      </div>

      {/* Mobile Menu */}
      <div className="mobile-menu" style={{
        display: isMenuOpen ? 'flex' : 'none',
        flexDirection: 'column',
        gap: '0.5rem',
        padding: '1rem',
        background: 'var(--white-pure)',
        borderTop: '1px solid var(--gray-light)',
        boxShadow: 'var(--shadow-medium)'
      }}>
        <NavButton
          
          label="Dashboard"
          path="/dashboard"
          onClick={() => {
            navigate('/dashboard');
            setIsMenuOpen(false);
          }}
        />
        
        <NavButton
          icon=""
          label="List Upload"
          path="/upload"
          onClick={() => {
            navigate('/upload');
            setIsMenuOpen(false);
          }}
        />
        
        <NavButton
          
          label="Agents"
          path="/agents"
          onClick={() => {
            navigate('/agents');
            setIsMenuOpen(false);
          }}
        />
        
        <NavButton
          icon="ðŸ“‹"
          label="Distribution"
          path="/distributed"
          onClick={() => {
            navigate('/distributed');
            setIsMenuOpen(false);
          }}
        />
        
        <button
          onClick={handleLogout}
          style={{
            display: 'flex',
            alignItems: 'center',
            gap: '0.5rem',
            padding: '0.875rem 1.25rem',
            borderRadius: '8px',
            border: '1px solid var(--gray-light)',
            background: 'var(--white-pure)',
            color: 'var(--red-primary)',
            fontWeight: '500',
            fontSize: '0.875rem',
            cursor: 'pointer',
            transition: 'all 0.3s ease',
            marginTop: '0.5rem'
          }}
        >
          <span style={{ fontSize: '1.1rem' }}>ðŸšª</span>
          Logout
        </button>
      </div>

      <style jsx>{`
        .nav-button:hover {
          background: var(--red-light) !important;
          color: var(--red-primary) !important;
          transform: translateY(-1px);
          box-shadow: var(--shadow-light);
        }
        
        .nav-button-active:hover {
          background: var(--gradient-red) !important;
          color: var(--white-pure) !important;
        }
        
        @media (max-width: 768px) {
          .nav-links {
            display: none !important;
          }
          
          .mobile-menu-btn {
            display: flex !important;
          }
        }
        
        @media (min-width: 769px) {
          .mobile-menu {
            display: none !important;
          }
        }
      `}</style>
    </nav>
  );
};

export default Navbar;
